import React,{Component} from 'react'
import {Jumbotron} from 'react-bootstrap'

export default class Home extends Component{
    render(){
        return(
            <Jumbotron>
            <h1>MyFinance.com</h1>
            <p>
              explore your inner self with our brand new website.
            </p>
          </Jumbotron>)
    }
}
